import React from "react";
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

function Input(){
    return (
    <div class="container">
    <div id="section">
        <form>
            <TextField
              id="outlined-multiline-flexible fullWidth margin-dense"
              label="UI Schema"
              margin="dense"
              fullWidth
              multiline
              maxRows={14}
            />
            <Button id="generator" variant="contained" size="small">Generate Form</Button>
        </form>
    </div>
    <div id="section">
        <form>
            <TextField
              id="outlined-multiline-flexible fullWidth margin-dense"
              label="UI Schema"
              margin="dense"
              fullWidth
              multiline
              maxRows={14}
            />
            <Button id="generator" variant="contained" size="small">Submit</Button>
        </form>
    </div>
    </div>
    );
}

export default Input;
